import React from 'react';
import './BreedSelect.css';

class BreedSelect extends React.Component {

onChange(event) {
    this.props.bars(event.target.value);
  }

  render () {
    return (
      <section className='breed-select-wrapper'>
        <div className='form-group'>
          <label>Select Breed:</label>
          <select className='custom-select' onChange={(event) => this.onChange(event)}>
            {this.props.breeds && this.props.breeds.map((item, index) => 
              <option key={index} value={item}>{item}</option>
            )}
          </select>
        </div>
      </section>
    );
  }

}

export default BreedSelect;
